  <div className="row">
    <div className="col-md-6 mt-5 home_head">
      <h1>{props.name}</h1>
      <h2>We offer 100% placement guarantee  with Web Development courses and that is why we are the no 1 React  training classes in Silvassa. At Classes, we train students for interviews and offer placements in corporate companies. Most of all, we make you capable of creating difficult applications too.</h2>
      <button className="home_btn">{props.btnname}</button>
    </div>
    <div className="col-md-6 mt-5 homeimage_d">
    <img src={imghome} width="300px" height="300px" alt="img1"/>
    </div>
    </div>
    </div>
  </div>
</div>
    </>
)

};
